.content ul {
  margin-left: 1.2em; }

.content strong {
  color: #fed501 !important; }

body {
  background-color: aliceblue; }

.container {
  max-width: 50%; }

@media screen and (max-width: 414px) {
  .container {
    max-width: 100% !important; } }

.hero .subtitle {
  color: #ccc !important; }

.image {
  margin-bottom: 1.4em; }
  .image img {
    animation: rotator 10s infinite linear;
    width: 50px; }

@keyframes rotator {
  from {
    transform: rotate(0); }
  to {
    transform: rotate(360deg); } }

.stack-info {
  position: fixed;
  bottom: 10px;
  right: 20px; }
  .stack-info a {
    display: flex;
    justify-content: center;
    align-items: center;
    border: 1px solid #a1e2d6;
    color: #a1e2d6;
    font-weight: 800;
    border-radius: 50%;
    width: 50px;
    height: 50px; }
    .stack-info a:hover {
      background-color: #a1e2d6;
      color: #fff; }

.modal-info {
  display: none;
  visibility: hidden;
  position: absolute;
  right: 50px;
  bottom: 50px;
  font-size: 12px;
  padding: 2em 1.4em;
  border-radius: 4px;
  background-color: #fff;
  transition: all .5s ease;
  box-shadow: 1px 8px 10px rgba(0, 0, 0, 0.2); }
  .modal-info .title {
    font-size: 14px;
    color: #23d160; }
  .modal-info ul {
    margin-left: 1.2em; }
  .modal-info.visible {
    display: block;
    visibility: visible;
    transition: all .4s ease; }
